    5 letter about our year end report we submit the following: 1)  Line 11(a)(iii),
    col B inadvertently added both line 11(a)(iii) col A & col B from the prior quarterly
    report to line 11(a)(iii) from col A in the year end report, resulting in col
    B showing an additional $4,990. This had been corrected.  2) This was the result
    of a spelling error in the name of a contributing PAC, resulting in it being listed
    as two separate PACs.  This error did not result in any excess contribution.  This
    error has been corrected.  3) Our Form EZ-1 was correct in the year end report.
    \ The figures in your letter did not include a $1,000 contribution received in
    November 2006 which was properly disclosed as being received for the 2008 election
    cycle.  This was verbally confirmed by FEC staff.  No correction on our year end
    report is necessary.  If you have any questions, please let me know.  Sincerely,
    Owen Malcolm, Treasurer."
